    private void createClassroom(String semester, String day, String hour, String building, String room){
        System.out.println("Sem: " +semester + " day: "+ day + " hour: "+hour+" building: "+building+" room: "+room);
        if (!building.equals("")) {
            ClassroomDBObject classroom = new ClassroomDBObject();
            if (semester.length()>17){
                classroom.setSemester('Y');
            } else {
                String sem = semester.substring(6, 7);
                if (sem.equals("א")) {
                    classroom.setSemester('A');
                } else {
                    classroom.setSemester('B');
                }
            }
            classroom.setDay(day.substring(0,1));
            //todo make it support 4 digits as well (for engineering buildings)
            classroom.SetBuildingNumber(Integer.parseInt(building.substring(building.length()-3,building.length())));
            classroom.SetClassNumber(Integer.parseInt(room));

            //todo add time to classroom, call mongodbmanager "add to db" function

            System.out.println("Sem: "+classroom.getSemester()+" day: "+classroom.getDay()+" hour: "+" building: "+classroom.getBuildingNumber()+" room: "+classroom.getClassNumber());
        }

    }

